// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import {FundRegistry} from "../FundRegistry.sol";

/// @notice Shared logic for Taipei AQI Fund program modules.
abstract contract ProgramModule_Base {
    struct EvaluationProof {
        bytes32 proofId;
        address recipient;
        uint256 amountNTD;
        uint256 coveragePermille;
        uint256 eventsProcessed;
        uint256 cemsValidPermille;
        uint256 pm25x10;
    }

    event EligibilityIssued(
        uint256 indexed programId,
        bytes32 indexed proofId,
        address indexed recipient,
        uint256 amountNTD
    );
    event PayoutExecuted(
        uint256 indexed programId,
        bytes32 indexed proofId,
        address indexed recipient,
        uint256 amountNTD
    );

    error InvalidRecipient();
    error InvalidAmount();
    error ProofAlreadyConsumed(bytes32 proofId);
    error NotEligible(bytes32 proofId);

    FundRegistry public immutable registry;
    uint256 public immutable programId;

    mapping(bytes32 => bool) private consumedProof;

    constructor(FundRegistry registry_, uint256 programId_) {
        registry = registry_;
        programId = programId_;
    }

    function evaluate(EvaluationProof calldata proof) external returns (bool) {
        if (proof.recipient == address(0)) revert InvalidRecipient();
        if (consumedProof[proof.proofId]) revert ProofAlreadyConsumed(proof.proofId);
        if (!_isEligible(proof)) revert NotEligible(proof.proofId);

        uint256 payoutAmount = _calculateAward(proof);
        if (payoutAmount == 0) revert InvalidAmount();

        consumedProof[proof.proofId] = true;

        emit EligibilityIssued(programId, proof.proofId, proof.recipient, payoutAmount);
        registry.increaseSpent(programId, payoutAmount);
        emit PayoutExecuted(programId, proof.proofId, proof.recipient, payoutAmount);

        return true;
    }

    function hasConsumed(bytes32 proofId) external view returns (bool) {
        return consumedProof[proofId];
    }

    function _isEligible(EvaluationProof calldata proof) internal view virtual returns (bool);

    function _calculateAward(EvaluationProof calldata proof) internal view virtual returns (uint256) {
        return proof.amountNTD;
    }
}

// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import {FundRegistry} from "../FundRegistry.sol";
import {ProgramModule_Base} from "./ProgramModule_Base.sol";

contract ProgramModule_Construction is ProgramModule_Base {
    uint256 public immutable maxPm25x10;

    constructor(FundRegistry registry_, uint256 programId_, uint256 maxPm25x10_)
        ProgramModule_Base(registry_, programId_)
    {
        maxPm25x10 = maxPm25x10_;
    }

    function _isEligible(EvaluationProof calldata proof) internal view override returns (bool) {
        return proof.pm25x10 <= maxPm25x10;
    }
}

// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import {FundRegistry} from "../FundRegistry.sol";
import {ProgramModule_Base} from "./ProgramModule_Base.sol";

contract ProgramModule_Fixed is ProgramModule_Base {
    uint256 public immutable minCemsValidPermille;

    constructor(FundRegistry registry_, uint256 programId_, uint256 minCemsValidPermille_)
        ProgramModule_Base(registry_, programId_)
    {
        minCemsValidPermille = minCemsValidPermille_;
    }

    function _isEligible(EvaluationProof calldata proof) internal view override returns (bool) {
        return proof.cemsValidPermille >= minCemsValidPermille;
    }
}

// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import {FundRegistry} from "../FundRegistry.sol";
import {ProgramModule_Base} from "./ProgramModule_Base.sol";

contract ProgramModule_IoT is ProgramModule_Base {
    uint256 public immutable minCoveragePermille;
    uint256 public immutable bonusCoveragePermille;
    uint256 public immutable weeklyAllocationNTD;

    constructor(
        FundRegistry registry_,
        uint256 programId_,
        uint256 minCoveragePermille_,
        uint256 bonusCoveragePermille_,
        uint256 weeklyAllocationNTD_
    ) ProgramModule_Base(registry_, programId_) {
        require(minCoveragePermille_ > 0, "IoT:min coverage");
        require(bonusCoveragePermille_ >= minCoveragePermille_, "IoT:bonus < min");
        require(weeklyAllocationNTD_ > 0, "IoT:allocation");

        minCoveragePermille = minCoveragePermille_;
        bonusCoveragePermille = bonusCoveragePermille_;
        weeklyAllocationNTD = weeklyAllocationNTD_;
    }

    function _isEligible(EvaluationProof calldata proof) internal view override returns (bool) {
        return proof.coveragePermille > minCoveragePermille;
    }

    function _calculateAward(EvaluationProof calldata proof) internal view override returns (uint256) {
        if (proof.coveragePermille >= bonusCoveragePermille) {
            return weeklyAllocationNTD;
        }
        if (proof.coveragePermille <= minCoveragePermille) {
            return 0;
        }

        uint256 span = bonusCoveragePermille - minCoveragePermille;
        if (span == 0) {
            return weeklyAllocationNTD;
        }

        uint256 earned = proof.coveragePermille - minCoveragePermille;
        return (weeklyAllocationNTD * earned) / span;
    }
}

// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import {FundRegistry} from "../FundRegistry.sol";
import {ProgramModule_Base} from "./ProgramModule_Base.sol";

contract ProgramModule_Vehicle is ProgramModule_Base {
    uint256 public immutable minEventsProcessed;

    constructor(FundRegistry registry_, uint256 programId_, uint256 minEventsProcessed_)
        ProgramModule_Base(registry_, programId_)
    {
        minEventsProcessed = minEventsProcessed_;
    }

    function _isEligible(EvaluationProof calldata proof) internal view override returns (bool) {
        return proof.eventsProcessed >= minEventsProcessed;
    }
}

